import React from "react";

export const ContactForm = ({
  name,
  setName,
  phone,
  setPhone,
  email,
  setEmail,
  handleSubmit
}) => {
  return (
    <>
    <form onSubmit={handleSubmit}>
      <label>
        <input
          type="text"
          name="Name"
          value={name}
          onChange={e => setName(e.target.value)}
          required
          placeholder="Contact Name"
          aria-label=""
        />
      </label>
    </form>
    </>
  );
};
